import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import './App.css';
import { Link, BrowserRouter, Route, Router } from 'react-router-dom';
import "primereact/resources/themes/saga-orange/theme.css";
import ReceiptList from './Receipt';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <Router>
    <Route path='/home'>
    <h1 className="title">
    CNPC Chuanqing Drilling Engineering Company Limited (CCDC)
    <img src="https://www.yswinch.com/wp-content/uploads/2017/11/cnpc-logo_d.jpg" className="imageLogo" />
    </h1>
    <App />
    </Route>
    <Route path='/list'>
      <ReceiptList></ReceiptList>
    </Route>
    </Router>
    </>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
